import React from 'react';
import { Grid, Image } from "semantic-ui-react";
import Message from './Message';

const ChatSection =  () => {
    return (
<Grid divided='vertically' className="section" stackable columns="equal">
<Grid.Row>
      <Grid.Column >
        <Message />
      </Grid.Column>
      <Grid.Column width={7}>
      <Message />
      </Grid.Column>
      <Grid.Column>
        <Image src="https://react.semantic-ui.com/images/wireframe/paragraph.png" />
      </Grid.Column>
    </Grid.Row>
</Grid>
    )
}

export default ChatSection;
